import React from "react";
import background from "../assets/image.png";

function About() {
    return (
        <div
            style={{
                backgroundImage: `url(${background})`,
                backgroundSize: "cover",
                backgroundPosition: "center",
                height: "100vh",
            }}
        >
            <h1>Bienvenue</h1>
        </div>
    );
}

export default About;
